  false,\n\t\"url\": null,\n\t\"notes\": \"The Fish Pathology (F013) data set contains
  data from examinations ofndiseased fishes. Although these data may be from field
  observations,nthey derive primarily from laboratory analyses. Data include: location,nand
  fishing duration, distance, and gear; catch statistics (e.g., totalnweight, number
  of individuals, age group, identity of diseases, andnnumber of diseased individuals)
  by species for any number of species;nand biological condition of selected specimens.
  The size, affectednorgan, location, and frequency of lesions may be reported for
  individualnspecimens. Specimens are identified with the NODC Taxonomic Code. Thesendata
  may be characteristics of individual lesions or average lesionnstatistics.\",\n\t\"license_title\":
